window.bookSummaryJSON = "<p>The Jedi move one step closer to saving the embattled galaxy, only to confront a formidable wall of resistance.</p> <p>The harrowing search for Zonama Sekot is finally over for Luke Skywalker, Jacen Solo, and the others aboard the <i>Jade Shadow</i>. But joy turns to alarm when the living planet sends a defiant message: it refuses to follow them back to a galaxy full of war, exploitation, and misery.</p> <p>While Luke works feverishly to persuade the elusive planet to reconsider, the Yuuzhan Vong launches a full-scale attack aimed at the heart of the New Alliance. Sent to defend a major communications base, Han and Leia find themselves hopelessly outnumbered. Reinforcements are just too far away to help before everything is destroyed, and the courageous pair must fight an unrelenting battle against staggering odds.</p>"; 
